window.bookSummaryJSON = "<p><b>Waking up as a clone with a broken memory? Not great when you're leading the resistance.&nbsp;</b></p> <p>Rhona has battled the malevolent AI intent on wiping out humanity since the first Machinations began - until sheâ€™s killed during a rescue mission gone wrong. Now, Rhona awakens to find herself transported to a new body, complete with her DNA and her personality.&nbsp;</p> <p>She's a clone...of herself. Except for her missing memories. Some of which could potentially turn the tide of the war.&nbsp;</p> <p>Trapped in the shadow of the life she knew and rejected by the man who once loved her, the reincarnated Rhona must fight to secure her place among old friends and newfound enemies - and quickly. For the machines are inching closer to exterminating humanity for good. And only Rhona, whoever she is now, can save them.&nbsp;</p> <p>Experience the unforgettable start of the Last Resistance series, a sci-fi thriller filled with heart, soul, and plenty of twists. Perfect for fans of <i>Orphan Black</i>,<i> Westworld</i>, <i>Robopocalypse</i>, and <i>Terminator</i>.</p>"; 
